(1, 'Открытие проекта', '<p>Проект стартует 7 сентября в 19:00 по Московскому времени. До этого можно только зарегистрироваться и пополнить свой баланс, что бы на старте не терять времени и просто сделать вклад.</p><br>\n<p>Администрация желает всем удачного профита :)</p>', '', '', 'Открытие проекта', '<p>Проект BIGCASHBOX стартует 7 сентября в 19:00 по Московскому времени. До этого можно только зарегистрироваться и пополнить свой баланс, что бы на старте не терять времени и просто сделать вклад.</p><br>\n<p>Администрация желает всем удачного профита :)</p>', '', '', '24.08.2013');
